import React, { useState, useEffect } from 'react';

/*
ITP 404, Final
Author: Carson Wang
Email: carsonw@usc.edu
*/

export default function TripForm() {
    const [resortList, setResortList] = useState([]);
    const [year, setYear] = useState('');
    const [startDate, setStartDate] = useState('');
    const [endDate, setEndDate] = useState('');
    const [resortName, setResortName] = useState('');
    const [note, setNote] = useState('');

    useEffect(() => {
        fetch('http://localhost:3000/resorts')
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => {
                setResortList(data);
            })
            .catch(error => {
                console.error('Error fetching resorts:', error);
            });
    }, []);

    const handleSubmit = async (e) => {
        e.preventDefault();

        const newTripDetail = {
            "date-start": startDate,
            "date-end": endDate,
            resortName,
            pass: resortList.find(resort => resort.Resort === resortName)?.['Ski Pass'] || 'Unknown',
            note
        };

        try {
            const response = await fetch(`http://localhost:3000/trips?id_year=${year}`);
            const data = await response.json();

            if (data.length > 0) {
                const existingEntry = data[0];
                existingEntry.details.push(newTripDetail);

                await fetch(`http://localhost:3000/trips/${existingEntry.id}`, {
                    method: 'PUT',
                    headers: { 'Content-Type': 'application/json' },
                    body: JSON.stringify(existingEntry)
                });
            } else {
                const newEntry = {
                    id_year: year,
                    details: [newTripDetail]
                };

                await fetch('http://localhost:3000/trips', {
                    method: 'POST',
                    headers: { 'Content-Type': 'application/json' },
                    body: JSON.stringify(newEntry)
                });
            }

            // Reset form fields
            setYear('2023');
            setStartDate('');
            setEndDate('');
            setResortName('');
            setNote('');

            if (!window.alert("You have successfully submitted the form!")) { window.location.reload(); }

        } catch (error) {
            console.error('Error:', error);
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <div class="form-row">
                <div class="form-group col-md-2">
                    Snow Season:
                    <input type="number" class="form-control" min="2023" value={year} onChange={(e) => setYear(e.target.value)} required data-testid="snow-season-input" />
                </div>
            </div>
            <div class="form-row">
                <div class="form-group col-md-2">
                    <label for="inputEmail4">Start Date:</label>
                    <input type="date" class="form-control" value={startDate} min={`${year}-01-01`} onChange={(e) => setStartDate(e.target.value)} required data-testid="start-date-input" />
                </div>
                <div class="form-group col-md-2">
                    <label for="inputPassword4">End Date:</label>
                    <input type="date" class="form-control" value={endDate} min={startDate} onChange={(e) => setEndDate(e.target.value)} required data-testid="end-date-input" />
                </div>
            </div>

            <div class="form-row">
                <div class="form-group col-md-4">
                    Select Resort Name:
                    <select class="form-select" aria-label="Default select example" value={resortName} onChange={(e) => setResortName(e.target.value)} required data-testid="resort-select">
                        <option value="">Select a resort</option>
                        {resortList.map((resort, index) => (
                            <option key={index} value={resort.Resort}>{resort.Resort}</option>
                        ))}
                    </select>
                </div>
            </div>

            <div class="form-row">
                <label for="exampleFormControlTextarea1" class="form-label">Trip Notes:</label>
                <textarea value={note} onChange={(e) => setNote(e.target.value)} class="form-control" id="exampleFormControlTextarea1" rows="3" data-testid="trip-notes-textarea"></textarea>
            </div>

            <div class="form-row">
                <button type="submit" class="btn btn-primary mb-3" data-testid="submit-button">Add Trip</button>
            </div>
        </form>
    );
};
